import React from "react";
import { connect } from "react-redux";
import HisList from "./HisList";
// import { getTodos } from "../redux/selectors";

const History = ({ newhist }) => (
  <div>
    <h3 className="history_title">History</h3>
        <ul>
      {newhist? newhist.map(newhist => {
        return <HisList key={`newhist-${newhist.id}`} his={newhist} />;
      })
      : null
      }
    </ul>
  </div>
);

const mapStateToProps = state => {
  const { byIds, allIds } = state.newHistory;
  console.log(byIds, 'shenme', allIds);
  const newhist =
    allIds ? allIds.map(id => {
      return byIds ?  {...byIds[id], id } : null;
    }) : null;
  console.log(newhist,'here');
  return {newhist};
};

export default connect(mapStateToProps)(History);
